import React from "react";
import "./App.css";
import UserProfile from "./components/UserProfile/UserProfile";
import SideBar from "./components/SideBar/SideBar";
import InfoForm from "./components/InfoForm/InfoForm";

function App() {
  return (
    <div className="App">
      <SideBar />
      <InfoForm />
      <UserProfile />
    </div>
  );
}

export default App;
